/* /components/Layout.js */

import React, { useContext } from "react";
import Head from "next/head";
import Link from "next/link";
import { Container, Nav, NavItem, Alert } from "reactstrap";
import { useAuth } from "../lib/auth2";
import Cart from "./cart";
import AppContext from "./context";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCartShopping } from "@fortawesome/free-solid-svg-icons";

const Layout = (props) => {
  const title = "Capstone Delivery App";
  const { cart } = useContext(AppContext);
  console.log(` CART ${cart.items.length}`);
  var { user, setUser, logout } = useAuth();

  return (
    <div>
      <Head>
        <title>{title}</title>
        <meta charSet='utf-8' />
        <meta
          name='viewport'
          content='initial-scale=1.0, width=device-width'
        />
        <link
          rel='stylesheet'
          href='https://maxcdn.bootstrapcdn.com/bootstrap/4.0.0/css/bootstrap.min.css'
          integrity='sha384-Gn5384xqQ1aoWXA+058RXPxPg6fy4IWvTNh0E263XmFcJlSAwiGgFAW/dAiS6JXm'
          crossOrigin='anonymous'
        />
        <script src='https://js.stripe.com/v3' />
      </Head>
      <header>
        <style jsx>
          {`
            a {
              color: white;
            }
            h5 {
              color: white;
              padding-top: 11px;
            }
          `}
        </style>

        <Nav className='navbar navbar-dark bg-dark'>
          <NavItem>
            <Link href='/'>
              <a className='navbar-brand'>Home</a>
            </Link>
          </NavItem>

          <NavItem>
            <Link href='/display'>
              <a className='ml-auto'>Display</a>
            </Link>
          </NavItem>

          <NavItem className='ml-auto'>
            {user ? (
              <h5>{user.username}</h5>
            ) : (
              <Link href='/register'>
                <a className='nav-link'> Sign up</a>
              </Link>
            )}
          </NavItem>

          <NavItem>
            {cart.items.length > 0 && (
              <div>
                <FontAwesomeIcon icon={faCartShopping} />
                <p>{cart.items.length}</p>
              </div>
            )}
          </NavItem>

          <NavItem>
            {user && (
              <Link href='/profile'>
                <a className='nav-link'> Profile</a>
              </Link>
            )}
          </NavItem>
          <NavItem>
            {user ? (
              <Link href='/'>
                <a
                  className='nav-link'
                  onClick={() => {
                    logout();
                    setUser(null);
                  }}>
                  Logout
                </a>
              </Link>
            ) : (
              <Link href='/login'>
                <a className='nav-link'>Sign in</a>
              </Link>
            )}
          </NavItem>
        </Nav>
      </header>
      <Container>{props.children}</Container>
    </div>
  );
};

export default Layout;
